S=""

N=0
L = len(S)
NA=[0,]
for i in range(L):
    if S[i]=='A':
        N+=1
        NA.append(N)
    else:
        NA.append(N)
maxL = 0
for i in range(L):
    if maxL+i>L:
        break
    for j in range(i+maxL,L+1,2):
        if NA[j]-NA[i]==(j-i)/2 and j-i>maxL:
            maxL=j-i
print(maxL)
